import React from 'react';
import { Stage, Layer, Rect } from 'react-konva';
import { defaultShape, stageDimensions } from '../../../../../../utils/defaults';

const Card: React.FC = (): JSX.Element => {
    return (
        <div className="">
            <Stage
                {...stageDimensions}
            >
                <Layer>
                    <Rect
                        {...defaultShape}
                    />
                </Layer>
            </Stage>
        </div>
    )
};
export default Card;
